  class Shot {
    constructor(x, y, id, xm, ym, type) {
      this.type = type;
      this.xm = xm;
      this.ym = ym;
      while (this.xm * this.xm + this.ym * this.ym > 1.2 || this.xm * this.xm + this.ym * this.ym < 1) {
        if (this.xm * this.xm + this.ym * this.ym > 1.1) {
          this.xm /= 1.01;
          this.ym /= 1.01;
        }
        if (this.xm * this.xm + this.ym * this.ym < 1.1) {
          this.xm *= 1.01;
          this.ym *= 1.01;
        }
      }
      this.xm = this.xm * 7;
      this.ym = this.ym * 7;
      this.y = y;
      this.x = x;
      while ((this.x < x + 35 && this.x > x - 35) && (this.y < y + 35 && this.y > y - 35)) {
        this.x = this.x + xm / 5;
        this.y = this.y + ym / 5;
      }
      this.counter = 0;
      this.id = id;
    }

    draw() {
      if (this.type == 'bullet') {
        draw.fillStyle = "#000000";
        draw.fillRect(this.x, this.y, 5, 5);
      } else if (this.type == 'power_bullet') {
        draw.drawImage(power_bullet, this.x, this.y);
      } else if (this.type == 'mega_bullet') {
        draw.drawImage(mega_bullet, this.x, this.y);
      }
    }

    update() {
      this.x += this.xm / 2;
      this.y += this.ym / 2;
    }

  }
