  function levelReader(array, m, quad, borders) {
    Game.borders = borders;
    for (l = 0; l < array.length; l++) {
      for (q = 0; q < array[l].split("").length; q++) {
        var p = array[l].split(""); // Block key: # = invincible, 1 = weak, 2 = strong, @ = player, A = ai
        if (p[q] == "#") {
          if (quad) {
            if (Game.level == 'multiplayer' && m) user.host.blockData[l] += '#';
            wall(q - 10, l - 10, m);
          } else {
            wall(q, l, m);
          }
        } else if (p[q] == "1") {
          if (quad) {
            if (Game.level == 'multiplayer' && m) user.host.blockData[l] += '1';
            weak(q - 10, l - 10, m);
          } else {
            weak(q, l, m);
          }
        } else if (p[q] == "2") {
          if (quad) {
            if (Game.level == 'multiplayer' && m) user.host.blockData[l] += '2';
            strong(q - 10, l - 10, m);
          } else {
            strong(q, l, m);
          }
        } else if (p[q] == "A") {
          if (quad) {
            createAi((q - 10) * 50, (l - 10) * 50, m, 3, 3);
          } else {
            createAi(q * 50, l * 50, m, 3, 3);
          }
        } else {
          if (Game.level == 'multiplayer' && m) user.host.blockData[l] += ' ';
        }
      }
    }
  }
